import Vue from "vue";
import Vuex from "vuex";
import grounding from "./grounding";
import warehouseQuery from "./warehouseQuery";
import QRcode from "./QRcode";

Vue.use(Vuex);
const store = new Vuex.Store({
    modules:{
        grounding,
        warehouseQuery,
        QRcode
    }
});
export default store;
